def Transcription(text):
    length=len(text)
    mRNA=""
    for i in range(length):
        if(text[i]=='T'):
            mRNA=mRNA+'U'
        else:
            mRNA=mRNA+text[i]    
    return mRNA

t=""
print(Transcription(t))